import React, { useState } from "react";
import Tabs from "react-simply-tabs";
import './Food.css'

import { Container, Row, Col, Form, Card, Button, CardGroup } from 'react-bootstrap';

//import Breakfast from '../../assest/breakfast.jpg'


const Food = () => {
    const [activeTabIndex, setTabIndex] = useState(0);
    return (
        <Container >
    
            <div className="tabs-details">
                <Tabs
                    activeTabIndex={activeTabIndex}
                    activeTabProps={{
                        className: "active",
                        style: {
                            background: "black",
                            color: "white"
                        }
                    }}
                    activeControlProps={{
                        className: "active",
                        style: { background: "red" }
                    }}
                    onRequestChange={setTabIndex}
                    controls={[
                        <button type="button" title="Show 1" className="tabControlClassName">
                            Show 1
                        </button>,
                        <button type="button" title="Show 2" className="tabControlClassName">
                            Show 2
                        </button>,
                        <button type="button" title="Show 3" className="tabControlClassName">
                            Show 3
                        </button>,

                        <button
                            type="button"
                            title="Show 1"
                            className="tabControlClassName"
                            tabIndex={0}
                        >
                            Show 1
                        </button>
                    ]}
                >
                    <div className="tabClassName">1 tab</div>

                    <div className="tabClassName">2 tab</div>

                    <div className="tabClassName">3 tab</div>
                </Tabs>


            </div>



        </Container>
    )

}



export default Food
